    <p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;line-height:normal;font-size:15px;font-family:"Calibri",sans-serif;background:white;'><span style='font-size:14px;font-family:"Arial",sans-serif;color:#363636;'>&nbsp;</span></p>
    <p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;line-height:15.0pt;font-size:15px;font-family:"Calibri",sans-serif;background:white;'><span style='font-size:14px;font-family:"Arial",sans-serif;color:#363636;'>Предоставляемая Вами персональная информация (имя, адрес, телефон, e-mail, номер кредитной карты) является конфиденциальной и не подлежит разглашению. Данные Вашей кредитной карты передаются только в зашифрованном виде и не сохраняются на нашем Web-сервере.</span></p>
    <p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;line-height:15.0pt;font-size:15px;font-family:"Calibri",sans-serif;background:white;'><span style='font-size:14px;font-family:"Arial",sans-serif;color:#363636;'><br>&nbsp;Мы рекомендуем вам проверить, что ваш браузер достаточно безопасен для проведения платежей онлайн, на&nbsp;</span><a href="https://my.cloudpayments.ru/ru/browser"><strong><span style='font-size:14px;font-family:"Arial",sans-serif;color:#21B7CF;'>специальной странице</span></strong></a><span style='font-size:14px;font-family:"Arial",sans-serif;color:#363636;'>.</span></p>
    <p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;line-height:15.0pt;font-size:15px;font-family:"Calibri",sans-serif;background:white;'><span style='font-size:14px;font-family:"Arial",sans-serif;color:#363636;'><br>&nbsp;Безопасность обработки Интернет-платежей гарантирует ТОО &laquo;CloudPayments Kazakhstan&raquo;. Все операции с платежными картами происходят в соответствии с требованиями VISA International, MasterCard и других платежных систем. При передаче информации используются специализированные технологии безопасности карточных онлайн-платежей, обработка данных ведется на безопасном высокотехнологичном сервере процессинговой компании.</span></p>
    <p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;line-height:15.0pt;font-size:15px;font-family:"Calibri",sans-serif;background:white;'><span style='font-size:14px;font-family:"Arial",sans-serif;color:#363636;'>&nbsp;</span></p>
    <p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;line-height:15.0pt;font-size:15px;font-family:"Calibri",sans-serif;background:white;'><span style='font-size:14px;font-family:"Arial",sans-serif;color:#363636;'>Оплата платежными картами безопасна, потому что:</span></p>
    <ul style="margin-bottom:0cm;" type="disc">
        <li style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:15.0pt;font-size:15px;font-family:"Calibri",sans-serif;color:#363636;background:white;'><span style='font-size:14px;font-family:"Arial",sans-serif;'>Система авторизации гарантирует покупателю, что платежные реквизиты его платежной карты (номер, срок действия, CVV2/CVC2) не попадут в руки мошенников, так как эти данные не хранятся на сервере авторизации и не могут быть похищены.</span></li>
        <li style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:15.0pt;font-size:15px;font-family:"Calibri",sans-serif;color:#363636;background:white;'><span style='font-size:14px;font-family:"Arial",sans-serif;'>Покупатель вводит свои платежные данные непосредственно в системе авторизации CloudPayments, а не на сайте интернет-магазина, следовательно, платежные реквизиты карточки покупателя не будут доступны третьим лицам.</span></li>
