    <p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;line-height:15.0pt;font-size:15px;font-family:"Calibri",sans-serif;background:white;'><span style='font-size:14px;font-family:"Arial",sans-serif;color:#363636;'>&nbsp;</span></p>
    <p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;line-height:15.0pt;font-size:15px;font-family:"Calibri",sans-serif;background:white;'><span style='font-size:14px;font-family:"Arial",sans-serif;color:#363636;'>При проведении онлайн-оплаты посредством платежных карт не допускается возврат наличными денежными средствами. Порядок возврата регулируется правилами международных платежных систем:</span></p>
    <ol start="1" style="margin-bottom:0cm;" type="1">
        <li style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:15.0pt;font-size:15px;font-family:"Calibri",sans-serif;color:#363636;background:white;'><span style='font-size:14px;font-family:"Arial",sans-serif;'>Потребитель вправе отказаться от товара в любое время до его передачи, после передачи товара отказ необходимо оформить в течение 14 дней;</span></li>
        <li style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:15.0pt;font-size:15px;font-family:"Calibri",sans-serif;color:#363636;background:white;'><span style='font-size:14px;font-family:"Arial",sans-serif;'>Возврат товара надлежащего качества возможен в случае, если сохранены его товарный вид, потребительские свойства, а также документ, подтверждающий факт и условия покупки указанного товара;</span></li>
        <li style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:15.0pt;font-size:15px;font-family:"Calibri",sans-serif;color:#363636;background:white;'><span style='font-size:14px;font-family:"Arial",sans-serif;'>Потребитель не вправе отказаться от товара надлежащего качества, имеющего индивидуально-определенные свойства, если указанный товар может быть использован исключительно приобретающим его человеком;</span></li>
        <li style='margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:15.0pt;font-size:15px;font-family:"Calibri",sans-serif;color:#363636;background:white;'><span style='font-size:14px;font-family:"Arial",sans-serif;'>При отказе от товара со стороны потребителя продавец должен вернуть ему денежную сумму, уплаченную потребителем, не позднее чем через десять дней со дня предъявления потребителем соответствующего требования.</span></li>
    </ol>
    <p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;line-height:15.0pt;font-size:15px;font-family:"Calibri",sans-serif;background:white;'><span style='font-size:14px;font-family:"Arial",sans-serif;color:#363636;'>Для возврата денежных средств на банковскую карту необходимо заполнить &laquo;Заявление о возврате денежных средств&raquo;, которое высылается по требованию компанией на электронный адрес, и отправить его вместе с приложением копии документа, удостоверяющего личность, по адресу&nbsp;</span><strong>supporn@briincorp.com</strong>.</p>
    <p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;line-height:15.0pt;font-size:15px;font-family:"Calibri",sans-serif;background:white;'><span style='font-size:14px;font-family:"Arial",sans-serif;color:#363636;'><br>&nbsp;Возврат денежных средств будет осуществлен на банковскую карту в течение ___ рабочего дня со дня получения &laquo;Заявление о возврате денежных средств&raquo; Компанией.</span></p>
    <p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;line-height:15.0pt;font-size:15px;font-family:"Calibri",sans-serif;background:white;'><span style='font-size:14px;font-family:"Arial",sans-serif;color:#363636;'>&nbsp;</span></p>
    <p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;line-height:15.0pt;font-size:15px;font-family:"Calibri",sans-serif;background:white;'><span style='font-size:14px;font-family:"Arial",sans-serif;color:#363636;'>Для возврата денежных средств по операциям, проведенным с ошибками, необходимо обратиться с письменным заявлением и приложением копии документа, удостоверяющего личность, и чеков/квитанций, подтверждающих ошибочное списание. Данное заявление необходимо направить по адресу&nbsp;</span><strong>supporn@briincorp.com.</strong></p>
